export const menu = [
    {
        id: 'home',
        title: 'Início',
        type: 'item',
        icon: 'home',
        url: 'home'
    },
    {
        id: 'provider',
        title: 'Fornecedores',
        type: 'item',
        icon: 'truck',
        url: 'fornecedores'
    },
    {
        id: 'apps',
        type: 'section',
        title: 'Parâmetros',
        icon: 'package',
        children: [
            {
                id: 'category',
                title: 'Categoria',
                type: 'item',
                icon: 'mail',
                url: 'apps/email'
            },
        ]
    },
    {
        id: 'pages',
        title: 'Pages',
        translate: 'MENU.PAGES.SECTION',
        type: 'collapsible',
        icon: 'file-text',
        children: [
            {
                id: 'authentication',
                title: 'Authentication',
                translate: 'MENU.PAGES.AUTH.COLLAPSIBLE',
                type: 'collapsible',
                icon: 'circle',
                children: [
                    {
                        id: 'login-v1',
                        title: 'Login V1',
                        translate: 'MENU.PAGES.AUTH.LOGIN1',
                        type: 'item',
                        url: 'pages/authentication/login-v1',
                        openInNewTab: true
                    },
                    {
                        id: 'login-v2',
                        title: 'Login V2',
                        translate: 'MENU.PAGES.AUTH.LOGIN2',
                        type: 'item',
                        url: 'pages/authentication/login-v2',
                        openInNewTab: true
                    },
                ]
            }
        ]
    }
];
